import React, { useState } from "react";
import { Grid, InputLabel, TextField } from "@material-ui/core";
import InputForm from "./Input";

export default function MemberInput() {
  const [inputValue, setInputValue] = useState({
    code: "",
    firstName: "",
    lastName: "",
    username: "",
    email: "",
    country: "",
    gender: "",
  });

  const inputList = [
    {
      width: 12,
      label: "Personal Invite Code",
      type: "text",
      name: "code",
      value: inputValue.code,
      place: "Customize your Personal Invite Code",
      caption:
        "PLEASE NOTE: Once you save the code, it can't be changed later, so please make sure it's what you want.",
    },
    {
      width: 6,
      label: "First Name",
      type: "text",
      value: inputValue.firstName,
      name: "firstName",
      place: "",
      caption: "",
    },
    {
      width: 6,
      label: "Last Name",
      type: "text",
      value: inputValue.lastName,
      place: "",
      caption: "",
      name: "lastName",
    },
    {
      width: 12,
      label: "Nickname",
      type: "text",
      value: inputValue.username,
      place: "",
      caption: "",
      name: "username",
    },
    {
      width: 12,
      label: "Email",
      type: "text",
      disabled: true,
      value: inputValue.email,
      place: "",
      caption: "",
      name: "email",
    },
    {
      width: 12,
      label: "Country/Region",
      type: "text",
      value: inputValue.email,
      place: "",
      name: "country",
      caption: "",
    },
  ];
  return (
    <>
      <Grid container spacing={1}>
        {inputList.map((item, index) => {
          return <InputForm item={item} key={index} />;
        })}
      </Grid>
    </>
  );
}
